import React from "react";
import styled from "styled-components";
import Track from "./Track";
import fearless from "../assets/fearless.png";

const Wrapper = styled.div`
background-color: #d9c78f;
`

const Ul = styled.ul`{
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 0;
  width: fit-content;
  padding: 0 10px;
  margin: 0 auto;
}`

const Li = styled.li`{
  list-style: none;
  text-transform: uppercase;
  font-weight: 500;
  color: white;
  font-size: 1rem;
};`

const Img = styled.img`{
  width: 100%;
  height: 100%;
  object-fit: cover;
  object-position: center;
  margin: 0 auto;
  padding: 0;
  display: block;

}`

export default function Tracks({ tracks, handleToggle }) {


  return (
    <Wrapper>
      <Ul>
        {tracks.map((track, i) => {
          return (
            <Li>
              <Track track={track} handleToggle={handleToggle} key={i} />
            </Li>
          )
        }
        )}
      </Ul>
      <img src={fearless} alt="Fearless (Taylor's Version)" />
    </Wrapper>
  );
}
